// get all nonrepeating substrings.  return arrays of [length, pos, substring].
function nonrepeats(str) {
	result = [];
	for (var i=0; i<str.length; i++) {
		var sub = str.substring(i);
		var seen = [];
		var sub2;
		for (var j=0; j<sub.length; j++) {
			ch = sub[j];
			if (seen[ch]) {
				sub2 = sub.substring(0, j);
				break;
			}
			seen[ch] = true;
			if (j==sub.length-1) {
				// got to end of input
				sub2 = sub;
			}
		}
		result[result.length] = [sub2.length, i, sub2];
	}
	return result;
}
// get nonrepeating substrings of the given length
function nonrepeatsForLength(str, length) {
	var non = nonrepeats(str);
	var result = [];
	for (var i=0; i<non.length; i++) {
		if (non[i][0] == length) result[result.length] = non[i]; 
	}		
	return result;
}